import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="min-h-screen flex flex-col">
      {/* Navbar */}
      <header className="bg-gray-800 text-white py-4">
        <div className="container mx-auto flex justify-between items-center">
          <div className="text-2xl font-bold">
            LOGO
          </div>
          <nav className="space-x-8">
            <Link to="/" className="hover:text-gray-400">Home</Link>
            <Link to="/about" className="hover:text-gray-400">About</Link>
            <Link to="/contact" className="hover:text-gray-400">Contact Us</Link>
          </nav>
          <div className="space-x-4">
            {/* Intentionally left blank */}
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="flex-grow flex items-center justify-center">
        <div className="text-center">
          <h1 className="text-5xl font-bold text-gray-800 mb-4">Welcome!</h1>
          <p className="text-lg text-gray-600 mb-8">This is a basic template of a full-stack app.</p>
          <div className="space-y-4">
            <Link to="/login" className="block bg-blue-500 hover:bg-blue-600 text-white px-6 py-3 rounded-lg text-xl">Login</Link>
            <Link to="/register" className="block bg-green-500 hover:bg-green-600 text-white px-6 py-3 rounded-lg text-xl">Register</Link>
          </div>
        </div>
      </main>
    </div>
  );
};

export default Home;
